import AppInfo from "../app-info/app-info";
import SearchPanel from "../search-panel/search-panel";
import AppFilter from "../app-filter/app-filter";
import "./app.css";
import EmployeesList from "../employees-list/employees-list";
import EmployeesAddForm from "../employees-add-form/employees-add-form";

function App() {
  function increase(salary) {
    if (salary >= 1000) {
      return true;
    } else {
      return false;
    }
  }
  const data = [
    { name: "John Smith", salary: 900, increase: increase(this.salary)},
    { name: "Jack Daniels", salary: 3000, increase: increase(this.salary) },
    { name: "James Bond", salary: 1500, increase: increase(this.salary) },
  ];

  return (
    <div className="app">
      <AppInfo />
      <div className="search-panel">
        <SearchPanel />
        <AppFilter />
      </div>
      <EmployeesList data={data} />
      <EmployeesAddForm />
    </div>
  );
}

export default App;
